import React from "react";
class Dad extends React.Component{
    state={
        name:"naveen",
        age:24,
        salary:"up our company"
    }
    handlechange=()=>{
        this.setState({
            name:"chinna",
            age:23,
            salary:"on my decision"
        })
    }
    render(){
        return(
            <div>
            <p>{this.state.name}</p>
            <p>{this.state.age}</p>
            <p>{this.state.salary}</p>
            <button onClick={this.handlechange}>udpate</button>
              
            </div>

        )
    }
        
    }
    export default Dad;
